import React from "react";

class DetailPost extends React.Component {
  render() {
    return (
      <div>
        <p>this is detail post</p>
        <p>Title : {this.props.post.title}</p>
        <p>{this.props.post.category}</p>
        <p>{this.props.item.details}</p>
      </div>
    );
  }
}

export default DetailPost;
